- input: "TEXT\x1CC00277541\x1C.TEXT\x1C\x1CF3XA\x1CThis amendment corrects some erroneous
    entries by which the Committee appeared to allocate administrative expenses. The
    Fairfax County Demcoratic Committee does not allocate administrative expenses
    but rather charges its administrative expenses one hundred percent to its federal
    account. In the course of reviewing this report to answer a letter from Laura
    Sinram, Senior Campaign Finance Analyst, Reports Analysis Division, we discovered
    that the beginning and ending balances for a number of its FEC reports, including
    this one, required modifications to match the beginning and ending balances as
    reflected in the books and records of the Committee. This amendment corrects the
    discrepancies which made the Mid Year 2007 report appear to be out of balance
    with the books and records. The Committee conducts fund raising only on befhalf
    of the Democratic Party and not on behalf of any candidate for any federal office,
    so all fund raising expenses in our reports are party fund raising, with no federal
    candidate beneficiary. This amendment should close revisions to the 2007 mid year
    reporting period. "
